import ReorderIcon from "@mui/icons-material/Reorder";
import { IconButton } from "@mui/icons/core";
const Header = () => {
  return (
    <div>
      <h1>Iam Header!!</h1>
      <IconButton>
        <ReorderIcon></ReorderIcon>
      </IconButton>
    </div>
  );
};

export default Header;
